import moment from 'moment';

export function getDictCount(dateDict, startDateStr, endDateStr) {
    let startDate = moment(startDateStr, "L")
    let endDate = moment(endDateStr, "L").endOf('day');

    let count = 0
    for (let i = 0; i < dateDict.keys().length; i++) {
      let date = dateDict.keys()[i]

      if (moment(date, "L").isBetween(startDate, endDate))
        count += dateDict[date]
    }

    return count
}

export function getLayeredDictCount(dateDict, startDateStr, endDateStr) {
    let startDate = moment(startDateStr, "L")
    let endDate = moment(endDateStr, "L").endOf('day');

    let ret = {}

    for (let i = 0; i < dateDict.keys().length; i++) {
      let date = dateDict.keys()[i]

        if (moment(date, "L").isBetween(startDate, endDate)) {
            let innerDict = dateDict[date]
            for (let j = 0; j < innerDict.keys().length; j++) {
                let key = innerDict.keys()[i]
                ret[key] = key in ret ? ret[key] + innerDict[key] : innerDict[key]
            }
        }
    }

    return ret
}
